-- ----------------------------
-- Procedure structure for `outtime`
-- ----------------------------
DROP PROCEDURE IF EXISTS `outtime`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `outtime`()
BEGIN 
DECLARE timestatus VARCHAR(255);
DECLARE task_id VARCHAR(255);
DECLARE to_id VARCHAR(255);
-- 定义游标
DECLARE rs_cursor CURSOR FOR
select if(date_add(b.createtime,INTERVAL a.task_yxsj minute)<now(),'1','0')as status, 
a.id,b.id from t_task a,t_task_order b 
where a.id=b.to_taskid and b.del_flag=0 and b.to_type='1';
OPEN rs_cursor;
cursor_loop:LOOP
FETCH rs_cursor INTO timestatus,task_id,to_id; -- 取数据
IF timestatus='1' THEN
-- 更新表t_task中的数量+1,t_task_order中的to_type=3;del_flag=1
update t_task set task_amount=task_amount+1 where id=task_id;
update t_task_order set to_type='3',del_flag=1 where id=to_id;
END IF;
END LOOP cursor_loop;
CLOSE rs_cursor;
END
;;
DELIMITER ;

-- ----------------------------
-- Event structure for `eventJob`
-- ----------------------------
DROP EVENT IF EXISTS `eventJob`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` EVENT `eventJob` ON SCHEDULE EVERY 1 SECOND STARTS '2017-11-12 21:17:19' ON COMPLETION PRESERVE ENABLE DO call outtime()
;;
DELIMITER ;
